import React from "react";

function Popup(props) {
    function insidePopup() {
        return (
            <div>
                <button type="button">Close</button>
            </div>
        )
    }
    return (
        <div>
            {props.trigger === true ? insidePopup() : null}
        </div>
    );
}

export default Popup;
